import classes from './AboutMe.module.css';

import React from 'react';

export default function AboutMe(props) {
    return (
        <div>
            <div className={classes.ImageContainer}>
                <img 
                    src="../../../assets/martin-hodsman-2020.jpg" 
                    alt="Martin Hodsman in 2020" />
            </div>
            <div>
                <h1>Hello, it's me!</h1>
                <p>Hey, I am Martin and I love to learn. I would like to connect with other developers and I would be thrilled to work in a team.</p>
                <p>I am a pretty passionate guy doing a lot of different activities: I am into skateboarding, surfing and fitness. I am also into practicing new languages - currently portuges. All these things have one thing in common: They are about learning, about being dedicated and about being creative.</p>
                <p>I have been working in online marketing a few years now and looking back, it was only a question of time that coding catches me. So for about a year now, I have been learning JavaScript, React and much more. This game is my second project. My first one is a fullstack shoppinglist app using React, Express.js and MongoDB. There it is: https://myshopping-9ecf1.web.app/</p>
                <p>I am 35 years old and I live close to Cologne, Germany.</p>
                <h2>Feel free to contact me</h2>
                <p>LinkedIn / XING</p>
                <p>So far, I have been working on my own. I would like to get to know other people that are into coding.</p>
            </div>
        </div>
    );
}
